import React from 'react'
import { Image } from '@mui/icons-material';
import { Box } from '@mui/system';
import { Container, Typography } from '@mui/material';


const LandingPages = () => {
  return (
    <div>
      <Box
      sx={{
        width: '100%',
        height: '275px',
        backgroundImage: `url(${'./landingpageimagetop.svg'})`,
        backgroundRepeat: "no-repeat",
        backgroundPosition: "center",
        backgroundSize: "cover"
      }}

      >
        <Container maxWidth='xl'> 
          <Typography>
            Halo Gaes
          </Typography>

        </Container>
      </Box>

      <Container 
      spacing={3}

      sx={{
        display: 'flex',
        gap:'30px',
        alignItems: 'center',
        justifyContent: 'center'

      }}>
        <Box 
        sx={{
          width: '324px',
          height: '207px',
          border: '1px solid #BDBDBD',
          borderRadius: '20px'
        }}>

        </Box>
        <Box 
        sx={{
          width: '324px',
          height: '207px',
          border: '1px solid #BDBDBD',
          borderRadius: '20px'
        }}>

        </Box>
        <Box 
        sx={{
          width: '324px',
          height: '207px',
          border: '1px solid #BDBDBD',
          borderRadius: '20px'
        }}>

        </Box>

      </Container>
      <h1> Lnading Pages</h1>
    </div>
  )
}

export default LandingPages;
